function getJSON(e){const n=new XMLHttpRequest;n.overrideMimeType("application/json"),n.open("GET","../groceries.json",!0),n.onreadystatechange=function(){4==n.readyState&&200==n.status&&e(n.response)},n.send(null)}getJSON(e=>{let n=JSON.parse(e).map(e=>`\n    <li class="groceryItem" tabindex="0">\n        <div class="qty">Qty: ${e.qty}</div>\n        <div class="middleContent">\n          <div class="item">${e.item}</div>\n          <hr/>\n          <div class=brandTypes> ${e.brand} ${e.type}</div>\n        </div>\n        <div class="productCategory">${e.category}</div>\n    </li>\n    `).join("");document.querySelector("#groceryListContainer").innerHTML=n});